&lt;p&gt;The Arboretum:&nbsp;&lt;br /&gt;
Service 1: Aesthetics (indirect/cultural): Provides a preserved natural scenery typical of the mountains.&lt;/p&gt;

&lt;p&gt;Service 2: Activity space (indirect, cultural)&nbsp;the arboretum provides a space for exercise and other recreational activity&lt;/p&gt;

&lt;p&gt;Service 3: Pollination and wildlife (Regulating, direct): the arboretum has local flowering plants that attract bee populations to the surrounding area. The arboretum also provides a preserved space for plant species, keeping genetic variability high.&nbsp;&lt;/p&gt;

&lt;p&gt;The Quad:&lt;/p&gt;

&lt;p&gt;Service 1: Aesthetics (Cultural, Indirect): Makes campus look nice, provides a central space for students and staff&lt;/p&gt;

&lt;p&gt;Service 2: Space (Cultural/indirect): The quad offers open green space for recreational activities.&lt;/p&gt;

&lt;p&gt;Service 3: Shelter for the Quad Cats (Cultural, Direct): The quad provides shelter for the quad cats, celebrated animals on the quad.&lt;br /&gt;
